            })
            .on('progress', (progress) => {
                console.log(`Notification job ${job.id || 'test'} ${progress}% complete`);
            });

        job.save((err) => {
            if (!err) console.log(`Notification job created: ${job.id || 'test'}`);
        });
    });
}

